CREATE TABLE Clients (
  clientId varchar(36) NOT NULL,
  name varchar(200) DEFAULT NULL,
  PRIMARY KEY (clientId)
) ;


CREATE TABLE Properties (
  propertyId varchar(36) NOT NULL,
  clientId varchar(36) DEFAULT NULL,
  name varchar(200) DEFAULT NULL,
  code varchar(10) DEFAULT NULL,
  PRIMARY KEY (propertyId),
  CONSTRAINT fkClients FOREIGN KEY (clientId) REFERENCES Clients (clientId)
);




CREATE TABLE AuditCompanies (
  auditcompanyId varchar(36) NOT NULL,
  name varchar(200) DEFAULT NULL,
  PRIMARY KEY (auditcompanyId)
) ;



CREATE TABLE Audits (
  auditId varchar(36) NOT NULL,
  auditDate datetime DEFAULT NULL,
  auditcompanyId varchar(36) DEFAULT NULL,
  propertyId varchar(36) DEFAULT NULL,
  status varchar(45) DEFAULT NULL,
  assessmentTypeId varchar(10) DEFAULT NULL,
  completedDate datetime DEFAULT NULL,
  PRIMARY KEY (auditId),
  CONSTRAINT fkAuditCompanys FOREIGN KEY (auditcompanyId) REFERENCES AuditCompanies (auditcompanyId),
  CONSTRAINT fkProperties FOREIGN KEY (propertyId) REFERENCES Properties (propertyId)
) ;


CREATE TABLE Floors (
  floorId varchar(36) NOT NULL,
  auditId varchar(36) DEFAULT NULL,
  name varchar(200) DEFAULT NULL,
  PRIMARY KEY (floorId),
  CONSTRAINT fkAudits FOREIGN KEY (auditId) REFERENCES Audits (auditId)
) ;


CREATE TABLE Areas (
  areaId varchar(36) NOT NULL,
  floorId varchar(36) DEFAULT NULL,
  name varchar(200) DEFAULT NULL,
  PRIMARY KEY (areaId),
  CONSTRAINT fkFloors FOREIGN KEY (floorId) REFERENCES Floors (floorId)
) ;


CREATE TABLE FireDoors (
  firedoorId varchar(36) NOT NULL,
  areaId varchar(36) DEFAULT NULL,
  barcode varchar(45) DEFAULT NULL,
  doorMaterial varchar(45) DEFAULT NULL,
  frameMaterial varchar(45) DEFAULT NULL,
  result varchar(45) DEFAULT NULL,
  PRIMARY KEY (firedoorId),
  CONSTRAINT fkAreas FOREIGN KEY (areaId) REFERENCES Areas (areaId)
) ;

